    true,nt"url": null,nt"notes": "Federal Information Technology Acquisition
    Reform Act (FITARA) enhances the  responsibility and authority of agency CIOs so
    as to increase their efficiency in managing and overseeing IT resources and assets.
    These responsibilities and authorities include, but are not limited to: IT portfolio
    review; budget formulation and approval of IT budgets; CIO appointing authority;
    enhanced transparency and risk management of IT investments; IT workforce planning;
    strategic sourcing; and consistency in reporting to strengthen accountability and
    manage cost, schedule, and performance measures for IT programs. rnrnSBAu2019s FITARA
    Implementation Plan describes the policies, processes, and guidance that require
    updates or revisions to meet Office of Management and Budget (OMB) objectives and
    comply with FITARA requirements.",nt"license_title": "U.S. Government Work",nt"extras":
